  "inlineSchema": "// Prisma schema for POS application\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"mysql\"\n  url      = env(\"DATABASE_URL\")\n}\n\nmodel User {\n  id           Int            @id @default(autoincrement())\n  role         Role\n  name         String\n  email        String         @unique\n  passwordHash String\n  active       Boolean        @default(true)\n  categories   UserCategory[]\n  sales        Sale[]         @relation(\"SellerSales\")\n  createdAt    DateTime       @default(now())\n  updatedAt    DateTime       @updatedAt\n}\n\nmodel Category {\n  id             Int            @id @default(autoincrement())\n  name           String\n  prefix         String         @unique\n  active         Boolean        @default(true)\n  products       Product[]\n  userCategories UserCategory[]\n  createdAt      DateTime       @default(now())\n  updatedAt      DateTime       @updatedAt\n\n  @@index([prefix])\n}\n\nmodel Product {\n  id                 Int                 @id @default(autoincrement())\n  categoryId         Int\n  code               String\n  name               String\n  unit               Unit\n  costBs             Decimal             @db.Decimal(10, 2)\n  priceBs            Decimal             @db.Decimal(10, 2)\n  priceUsd           Decimal             @db.Decimal(10, 2)\n  stock              Decimal             @default(0) @db.Decimal(10, 3)\n  minStock           Decimal             @default(0) @db.Decimal(10, 3)\n  active             Boolean             @default(true)\n  createdAt          DateTime            @default(now())\n  updatedAt          DateTime            @updatedAt\n  category           Category            @relation(fields: [categoryId], references: [id])\n  purchaseItems      PurchaseItem[]\n  saleItems          SaleItem[]\n  inventoryMovements InventoryMovement[]\n\n  @@unique([code])\n  @@index([categoryId, code])\n}\n\nmodel Client {\n  id        Int      @id @default(autoincrement())\n  name      String\n  rif       String?\n  address   String?\n  phone     String?\n  email     String?\n  active    Boolean  @default(true)\n  sales     Sale[]\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\nmodel Supplier {\n  id        Int        @id @default(autoincrement())\n  name      String\n  rif       String?\n  address   String?\n  contact   String?\n  active    Boolean    @default(true)\n  purchases Purchase[]\n  createdAt DateTime   @default(now())\n  updatedAt DateTime   @updatedAt\n}\n\nmodel Purchase {\n  id         Int            @id @default(autoincrement())\n  supplierId Int\n  currency   Currency\n  rate       Decimal        @db.Decimal(12, 6)\n  totalBs    Decimal        @db.Decimal(12, 2)\n  totalUsd   Decimal        @db.Decimal(12, 2)\n  createdAt  DateTime       @default(now())\n  updatedAt  DateTime       @updatedAt\n  supplier   Supplier       @relation(fields: [supplierId], references: [id])\n  items      PurchaseItem[]\n\n  // 👇👇 NUEVO: acumulados de pagos\n  paidBs  Decimal @default(0) @db.Decimal(12, 2)\n  paidUsd Decimal @default(0) @db.Decimal(12, 2)\n\n  // 👇👇 NUEVO: relación con pagos\n  payments PurchasePayment[]\n}\n\nmodel PurchasePayment {\n  id         Int           @id @default(autoincrement())\n  purchaseId Int\n  method     PaymentMethod\n  currency   Currency\n  rate       Decimal       @db.Decimal(12, 6)\n  amount     Decimal       @db.Decimal(12, 2) // monto en la moneda del pago\n  amountBs   Decimal       @db.Decimal(12, 2)\n  amountUsd  Decimal       @db.Decimal(12, 2)\n  note       String?\n  createdAt  DateTime      @default(now())\n  purchase   Purchase      @relation(fields: [purchaseId], references: [id])\n}\n\nmodel PurchaseItem {\n  id         Int      @id @default(autoincrement())\n  purchaseId Int\n  productId  Int\n  quantity   Decimal  @db.Decimal(12, 3)\n  unitCost   Decimal  @db.Decimal(12, 2) // cost in purchase currency\n  costBs     Decimal  @db.Decimal(12, 2) // computed cost in Bs\n  purchase   Purchase @relation(fields: [purchaseId], references: [id])\n  product    Product  @relation(fields: [productId], references: [id])\n}\n\nmodel Sale {\n  id            Int        @id @default(autoincrement())\n  clientId      Int?\n  sellerUserId  Int\n  currency      Currency\n  rate          Decimal    @db.Decimal(12, 6)\n  totalBs       Decimal    @db.Decimal(12, 2)\n  totalUsd      Decimal    @db.Decimal(12, 2)\n  invoiceNumber String     @unique\n  status        SaleStatus @default(OPEN)\n  paidBs        Decimal    @default(0) @db.Decimal(12, 2)\n  paidUsd       Decimal    @default(0) @db.Decimal(12, 2)\n  overrideNote  String?\n  createdAt     DateTime   @default(now())\n  updatedAt     DateTime   @updatedAt\n\n  client   Client?       @relation(fields: [clientId], references: [id])\n  seller   User          @relation(\"SellerSales\", fields: [sellerUserId], references: [id])\n  items    SaleItem[]\n  payments SalePayment[]\n}\n\nmodel SaleItem {\n  id        Int      @id @default(autoincrement())\n  saleId    Int\n  productId Int?\n  quantity  Decimal  @db.Decimal(12, 3)\n  unitPrice Decimal  @db.Decimal(12, 2) // en moneda de la venta\n  priceBs   Decimal  @db.Decimal(12, 2) // calculado en Bs\n  isFree    Boolean  @default(false)\n  sale      Sale     @relation(fields: [saleId], references: [id])\n  product   Product? @relation(fields: [productId], references: [id])\n}\n\nmodel SalePayment {\n  id        Int           @id @default(autoincrement())\n  saleId    Int\n  method    PaymentMethod\n  currency  Currency\n  rate      Decimal       @db.Decimal(12, 6)\n  amount    Decimal       @db.Decimal(12, 2) // en moneda del pago\n  amountBs  Decimal       @db.Decimal(12, 2)\n  amountUsd Decimal       @db.Decimal(12, 2)\n  note      String?\n  createdAt DateTime      @default(now())\n  sale      Sale          @relation(fields: [saleId], references: [id])\n}\n\nmodel InventoryMovement {\n  id            Int           @id @default(autoincrement())\n  productId     Int\n  type          MovementType\n  quantity      Decimal       @db.Decimal(12, 3)\n  unitCostBs    Decimal       @db.Decimal(12, 2)\n  referenceType ReferenceType\n  referenceId   Int\n  date          DateTime      @default(now())\n  product       Product       @relation(fields: [productId], references: [id])\n}\n\nmodel UserCategory {\n  id         Int      @id @default(autoincrement())\n  userId     Int\n  categoryId Int\n  user       User     @relation(fields: [userId], references: [id])\n  category   Category @relation(fields: [categoryId], references: [id])\n\n  @@unique([userId, categoryId])\n}\n\nmodel ExchangeRateLog {\n  id        Int        @id @default(autoincrement())\n  source    RateSource\n  value     Decimal    @db.Decimal(12, 6)\n  timestamp DateTime   @default(now())\n}\n\nenum Unit {\n  UNIT\n  KG\n}\n\nenum Role {\n  admin\n  seller\n}\n\nenum MovementType {\n  IN\n  OUT\n}\n\nenum ReferenceType {\n  PURCHASE\n  SALE\n  ADJUST\n}\n\nenum Currency {\n  USD\n  BS\n}\n\nenum RateSource {\n  bcv\n  manual\n}\n\nenum PaymentMethod {\n  CASH_BS\n  CASH_USD\n  DEBIT_CARD\n  PAGO_MOVIL\n  TRANSFER_BS\n  TRANSFER_USD\n}\n\nenum SaleStatus {\n  OPEN\n  PARTIAL\n  PAID\n  VOID\n}\n",
